	/* CalculateJ\uTr544[4:6] = skew (CalculateJ\Linkdim[1:3,5]) * CalculateJ\omega5; */
	m_M[73].mat[0] = m_M[2].mat[4];
	m_M[73].mat[1] = m_M[2].mat[10];
	m_M[73].mat[2] = m_M[2].mat[16];
	XXMatrixSkew (&m_M[72], &m_M[73]);
	XXMatrixMul (&m_M[71], &m_M[72], &m_M[7]);
	m_M[12].mat[3] = m_M[71].mat[0];
