	/* CalculateJ\controllableJ[1:6,1] = Adjoint (CalculateJ\Href0) * CalculateJ\uTr1refref; */
	XXMatrixAdjoint (&m_M[75], &m_M[25]);
	XXMatrixMul (&m_M[74], &m_M[75], &m_M[8]);
