	/* VirtualPosition\output = homogeneous (VirtualPosition\R, VirtualPosition\xyzQuart[1:3]); */
	m_M[87].mat[0] = m_M[49].mat[0];
	m_M[87].mat[1] = m_M[49].mat[1];
	m_M[87].mat[2] = m_M[49].mat[2];
